import React from 'react';

import { Jumbotron, Button, OverlayTrigger, Popover } from 'react-bootstrap';
import { Grid, Image, Header } from 'semantic-ui-react';

import Footer from '../Footer';

import Flash from "react-reveal/Flash";

import "../css/Services.css";
import '../../App.css';


const Services = () => {
  return (
  	<>
  		<Head />
  		<ServiceSection />
  		<Footer />
  	</>
  );
};

const popover = (
  <Popover id="popover-basic">
    <Popover.Title as="h3">No FEAR</Popover.Title>
    <Popover.Content>
      We accept any challenge! Let us know what you need, and watch it get done!
    </Popover.Content>
  </Popover>
);

const Head = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<h1>OUR SERVICES</h1>
				    <p>
				    	We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <span className="flashCont"><Flash><OverlayTrigger trigger="hover" placement="right" overlay={popover}><span className="contactLink">contact</span></OverlayTrigger></Flash></span> us to maek ararngements.
				    </p>

	  				<p>
	    				<Button variant="primary">Make it Happen</Button>
	  				</p>
				</Jumbotron>
			</div>
		</>
	)
}

const ServiceSection = () => {
	return (
		<>
			<Grid centered>
				<Grid.Row columns={2}>
					<Grid.Column>
						<Header as="h1">Web Development</Header>
						<p>
							We offer a wide range of Web Development solutions raning from basic HTML Pesonal sites, to full blown CMS Apps deisgned to meeting the demands of business.
						</p>
						<Button>Get a FREE Quote</Button>
					</Grid.Column>
					<Grid.Column>
						<Image src="https://images.pexels.com/photos/1789968/pexels-photo-1789968.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
					</Grid.Column>
				</Grid.Row>

				<Grid.Row columns={2}>
					<Grid.Column>
						<Image src="https://images.pexels.com/photos/67112/pexels-photo-67112.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
					</Grid.Column>
					<Grid.Column>
						<Header as="h1">Graphic Design</Header>
						<p>
							We offer a wide range of Web Development solutions raning from basic HTML Pesonal sites, to full blown CMS Apps deisgned to meeting the demands of business.
						</p>
						<Button>Get a FREE Quote</Button>
					</Grid.Column>
				</Grid.Row>
			</Grid>
		</>
	)
}

export default Services;
